import React from 'react'
import quizlogo from './images/quiz.png'
function Header() {
    return (
        <div className="flex">
        <h3 className="font-bold text-black font-si">KIDS ACADEMY</h3>
        <img src={quizlogo} alt="logo quizz" />
        </div>
    )
}

export default Header
